func:
let rmc = {};
rmc.gps_time = msg.payload.dateTime;
rmc.speed = msg.payload.speedKnots;
msg.payload = rmc;
delete msg.port;
return msg;

let gga = {};
if (typeof msg.payload.lon === 'string' && typeof msg.payload.lat === 'string'){
    msg.payload.lon = 0;
    msg.payload.lat = 0;
}
gga.lon = msg.payload.lon;
gga.lat = msg.payload.lat;
gga.alt = msg.payload.alt;
gga.numsat = msg.payload.numSat;
msg.payload = gga;
delete msg.port;
return msg;

const str = JSON.stringify(msg.payload);
msg.payload = str;
return msg;

const firstCmd = "INSERT INTO HISTORY(no_unit, longitude, latitude, altitude, direction, speed, status_unit, geofence_id, geofence_name, gps_time, satellite, insertdate) values (";
const valueCmd = `"${msg.payload.no_unit}",${msg.payload.lon},${msg.payload.lat},${msg.payload.alt},${msg.payload.direction},${msg.payload.speed},${msg.payload.status_unit},${msg.payload.geofence_id},"${msg.payload.geofence_name}","${msg.payload.gps_time}",${msg.payload.numsat},strftime('%Y-%m-%d %H:%M:%f','now','localtime'))`;
const insert = firstCmd + valueCmd;
msg.topic = insert;
return msg;

if (msg.status.text.includes('Connected to')) {
    msg.statusNet = 0;
} else {
    msg.statusNet = 1;
}
return msg;

if(msg.payload === 0){
    msg.topic = "select count(*) from history"
} else {
    msg.topic = "";
}
return msg;

if(msg.payload[0]['count(*)'] !== 0){
    if (msg.payload[0]['count(*)'] >= 1) {
        if (msg.payload[0]['count(*)'] < 3000) {
            msg.topic = "SELECT * FROM HISTORY ORDER BY ROWID LIMIT " + msg.payload[0]['count(*)'].toString();
            msg.del = "DELETE FROM history WHERE rowid in (SELECT rowid FROM history LIMIT " + msg.payload[0]['count(*)'].toString() + " )";
        } else {
            msg.topic = "SELECT * FROM HISTORY ORDER BY ROWID LIMIT 3000"
            msg.del = "DELETE FROM history WHERE rowid in (SELECT rowid FROM history LIMIT 3000 )";
        }
    }
    else {
        msg.topic = "SELECT * FROM HISTORY ORDER BY ROWID LIMIT 1"
        msg.del = "DELETE FROM history WHERE rowid in (SELECT rowid FROM history LIMIT 1 )";
    }
}
else{
    msg.payload = "";
    msg.topic = "";
}
return msg;

if (typeof (msg.del) != "undefined"){
    msg.topic = msg.del;
}
delete msg.del;
return msg;

const str = JSON.stringify(msg.payload);
msg.payload = str.replace('[', '').replace(']', '').split('},').join('}\n');
delete msg.topic;
return msg;
